import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { getFilteredProducts } from "../api/productApi"; // yeni API fonksiyonu

const ProductList = () => {
  const [products, setProducts] = useState([]);
  const [filters, setFilters] = useState({
    BrandList: "",
    RAMList: "",
    StorageList: "",
    ColorList: "",
    PlatformList: "",
    MinPrice: "",
    MaxPrice: "",
    SearchTerm: ""
  });

  const navigate = useNavigate();

  const fetchFilteredProducts = async () => {
    try {
      const data = await getFilteredProducts(filters);
      setProducts(data);
    } catch (error) {
      console.error("Ürünler çekilirken hata:", error);
    }
  };

  useEffect(() => {
    fetchFilteredProducts();
  }, []);

  const handleChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const applyFilter = () => {
    fetchFilteredProducts();
  };

  return (
    <div className="container-fluid mt-5">
      <div className="row">
        {/* SOL FİLTRE PANELİ */}
        <div className="col-md-3">
          <div className="card p-3 shadow-sm">
            <h5>Filtrele</h5>

            <input type="text" className="form-control my-2" name="SearchTerm" placeholder="Ara..." value={filters.SearchTerm} onChange={handleChange} />

            <input type="text" className="form-control my-2" name="BrandList" placeholder="Marka (virgülle)" value={filters.BrandList} onChange={handleChange} />
            <input type="text" className="form-control my-2" name="RAMList" placeholder="RAM (ör: 4GB,8GB)" value={filters.RAMList} onChange={handleChange} />
            <input type="text" className="form-control my-2" name="StorageList" placeholder="Depolama" value={filters.StorageList} onChange={handleChange} />
            <input type="text" className="form-control my-2" name="ColorList" placeholder="Renkler" value={filters.ColorList} onChange={handleChange} />
            <input type="text" className="form-control my-2" name="PlatformList" placeholder="Platform (Trendyol, N11...)" value={filters.PlatformList} onChange={handleChange} />

            <div className="d-flex gap-2 my-2">
              <input type="number" className="form-control" name="MinPrice" placeholder="Min ₺" value={filters.MinPrice} onChange={handleChange} />
              <input type="number" className="form-control" name="MaxPrice" placeholder="Max ₺" value={filters.MaxPrice} onChange={handleChange} />
            </div>

            <button onClick={applyFilter} className="btn btn-success w-100 mt-2">Filtrele</button>
          </div>
        </div>

        {/* SAĞ ÜRÜN KARTLARI */}
        <div className="col-md-9">
          <div className="row">
            {products.map(product => (
              <div
                key={product.productID}
                className="col-sm-6 col-lg-4 col-xl-3 mb-4"
                onClick={() => navigate(`/product/${product.productID}`)}
                style={{ cursor: "pointer" }}
              >
                <div className="card h-100 shadow-sm border-0">
                  <div className="card-body text-center">
                    <img src={product.ecommercePageLogo} alt={product.ecommercePageName} style={{ width: 60 }} className="mb-2" />
                    <h5>{product.brandName} {product.modelName}</h5>
                    <p className="text-muted small">{product.productName}</p>
                    <p className="small">{product.ramCapacity} / {product.storage} / {product.batteryCapacity}</p>
                    <h6 className="text-success fw-bold">{product.discountedPrice} TL</h6>
                    <span className="badge bg-light text-dark">{product.ecommercePageName}</span>
                  </div>
                </div>
              </div>
            ))}
            {products.length === 0 && <p className="text-center mt-4">Ürün bulunamadı.</p>}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductList;
